package com.ucc2.master;

public class ValidateFatura {

	private String NumFatura;
	private String TypeHeader;
	
	public ValidateFatura() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public ValidateFatura(String numFatura, String typeHeader) {
		super();
		NumFatura = numFatura;
		TypeHeader = typeHeader;
	}

	/**
	 * @return the numFatura
	 */
	public String getNumFatura() {
		return NumFatura;
	}

	/**
	 * @param numFatura the numFatura to set
	 */
	public void setNumFatura(String numFatura) {
		NumFatura = numFatura;
	}

	/**
	 * @return the typeHeader
	 */
	public String getTypeHeader() {
		return TypeHeader;
	}

	/**
	 * @param typeHeader the typeHeader to set
	 */
	public void setTypeHeader(String typeHeader) {
		TypeHeader = typeHeader;
	}
	
	
}
